      "title": "Consent Form",
      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n  \u003Cdiv style=\"width: 90%;\"\u003E\n    \n    \u003Ch2\u003E知情同意书\u003C\u002Fh2\u003E\n\n    \u003Ch3\u003E了解文字的处理和其意义\u003C\u002Fh3\u003E\n\n    \u003Cp class=\"text-left\"\u003E您好！我们邀请您参加一项关于阅读是如何发生以及如何从单词中提取语义的研究。请您在同意参加研究之前，先阅读这份表格，并提出您可能有的任何问题。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E这项研究由哈里斯堡科技大学认知分析学教授Dr. Erin M. Buchanan主持。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E背景信息:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    在这项研究中，您将会被问到一些有关单词概念的不同问题。例如，定义单词的特征，评价单词的熟悉程度，或仅仅判断这是否是一个真词。  \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E实验程序:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    您将通过一台带有键盘的电脑完全在线完成这项研究，台式机或笔记本均可。实验前会有指导语，每个人的指导语是随机出现的。在完成实验后，您也可以了解更多有关这项研究的背景信息和研究目的。整个实验应该在三十分钟内完成。 \u003C\u002Fp\u003E\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E参加研究的风险和收益:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    本研究不会收集您的任何识别信息，因此，您的回答应该是匿名的。当前的研究与在线游戏类似，根据要求您完成的任务，可能会引起疲劳或无论的感觉。\n    \u003Cbr \u002F\u003E\n    参与这项研究对您并没有直接的好处。然而，您的回答将有助于我们对语言和认知记忆过程的了解。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E报酬:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E参加本研究，您有可能通过当地的研究人员获得报酬。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E保密性和数据共享:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    我们会采取措施，确保您所提供的信息都是匿名的。本研究的数据将被公开发表，供其他研究者使用；但是，没有数据表明和您的直接关系。您的名字或其他识别信息，不会进入数据库，在任何口头或书面报告中也不会提及您与本研究的关系。在任何出版物中，都不会出现您的可识别信息。\n    \u003Cbr \u002F\u003E\n    在您的数据与研究小组以外的人分析以前，任何潜在的识别信息都会被删除。这些匿名信息可能会被研究小组使用，或与其它研究人员共享，用于今后相关或不相关的研究目的。您的匿名数据也可能在某些在线数据库中储存，例如开发科学框架 (这是免费的数据存储库，需要注册才能访问)，这种方式使得其他研究人员和感兴趣的人可以访问数据，以便进一步分析。\n    \u003Cbr \u002F\u003E\n    请注意，您的数据将是匿名的，这意味着一旦您完成了研究，您不能要求将其删除。\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E研究的自愿性质:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    参加本研究是基于自愿目的。您是否参与的决定不会影响您目前或将来与哈里斯堡科技大学或当地机构的关系。如果您决定自愿参加，您可以自由地回答任何问题或在任何时候退出而不影响这些关系。\n您是否参与的决定不会影响您目前或将来与哈里斯堡科技大学或当地机构的关系。如果您决定自愿参加，您可以自由地回答任何问题或在任何时候退出而不影响这些关系。 \u003C\u002Fp\u003E\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E联系方式和问题:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    本研究由Dr. Erin M. Buchanan主导，与心理科学加速器合作 (Psychological Science Accelerator)。您现在可以提出您的任何问题。如果您以后有任何问题，我们鼓励你联系Dr. Erin M. Buchanan，邮件地址: ebuchanan@harrisburgu.edu。 \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E问题或顾虑:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    本研究已经通过哈里斯堡科技大学的机构审查委员会(IRB)审查。该委员会确定本研究符合州和联邦法律以及大学政策要求的人类研究对象保护义务。\n    \u003Cp class=\"text-left\"\u003E\u003Ca href=\"https:\u002F\u002Fosf.io\u002F7fnsh\u002Fdownload\"\u003E 如有需要，我们将提供此信息的副本以供您保存。\u003C\u002Fa\u003E\u003C\u002Fp\u003E\n\n    \u003C\u002Fdiv\u003E\n    \n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n  请按 \u003Ckbd\u003ESpace\u003C\u002Fkbd\u003E 同意本研究并继续。\n\u003C\u002Ffooter\u003E"
